import React, { Component } from 'react';
import Searchbox from './searchbox'
function Worlddisplay({items}){



console.log('helo',items)
    return(

    <div>{
      items.slice(1,(items).length).map(item=>
        <li class="table-row">
            <div class="col col-1"><b>{item.country}</b></div>
             <div class="col col-2"><b>{item.cases}</b></div>
      <div class="col col-3"><b>+{item.todayCases}</b></div>
              <div class="col col-4"><b>{item.deaths}</b></div>
      <div class="col col-5"><b>+{item.todayDeaths}</b></div>
               <div class="col col-6"><b>{item.recovered}</b></div>
               <div class="col col-7"><b>{item.active}</b></div>
               <div class="col col-8"><b>{item.critical}</b></div>
               <div class="col col-9"><b>{item.casesPerOneMillion}</b></div>
               <div class="col col-10"><b>{item.deathsPerOneMillion}</b></div>
               <div class="col col-11"><b>{item.totalTests}</b></div>
               <div class="col col-12"><b>{item.testsPerOneMillion}</b></div>

            </li>
      )

      }</div>
    )
}


export default Worlddisplay;
